import { useState } from "react";

const Navbar = () => {

    const {userName, setUserName} = useState("Raiyan");

    function LoginChange() {
        setUserName = "Shahadat Hossain";
    }

    function LogOutChange(userName, e) {
        console.log("Good Bye"+userName, e.target);
    }

    return ( 
        <nav className="navbar">
            <h1>The Dojo Blog</h1>
            <div className="links">
                <a href="/">Home</a>
                <a href="/create">New Blog</a>
                <button onClick={LoginChange}>LogIn</button>
                <button onClick={(e) => {
                    LogOutChange(' Raiyan', e);
                }}>LogOut</button>

                <a><b>{userName}</b></a>
            </div>
        </nav>
     );
}

export default Navbar;
